job_detail:
岗位职责： 
 参与业务需求设计讨论，基于ios平台进行应用程序开发;
 负责移动平台软件框架的研究，设计和实现、关键技术验证和选型等工作;
 完成ios项目设计、编码、测试和优化。
 开发针对不同的ios操作系统版本和屏幕尺寸的应用，并完成兼容性测试
 对所开发的APP、SDK进行版本更新及维护。
 编制产品的软件操作、导入等相关指导文件，确保产品的制造、检验和应用
 招聘要求： 
 精通ios手机平台，对ios底层接口有深入地了解，具有ios开发经验;
 开发基础良好，对手机软件性能优化、内存优化、安全等有一定了解，掌握常用ios应用架构;
 有丰富的项目开发经验，能独立承担开发任务;
 学习能力强，思维活跃,能对产品的需求快速的做出技术上的分析;
 具备良好的沟通协调能力和团队合作精神。
责任心强、工作踏实、能承受一定的工作压力，能接受加班。
